import Header from './Header.js';
import Footer from './Footer.js';
import calendar from "./img/calendar.jpg";


function Calendar () {
    return (
        <div>
            <Header />
            <h1 class="title">Calendar</h1>
            <img src={calendar} className="calendar"/>
            <Footer />
        </div> 
    )
}

export default Calendar;
